    return async function(...args) {
        let timeout;
        try {
            const result = await Promise.race([
                fn(...args),
                new Promise((_, reject) => timeout = setTimeout(() => reject('Time Limit Exceeded'), t))
            ]);
            clearTimeout(timeout);
            return result;
