        for (let right = left; right <= n; right++) {
            for (let i = left; i <= right; i++) {
                const coins = paddedNums[left - 1] * paddedNums[i] * paddedNums[right + 1] + dp[left][i - 1] + dp[i + 1][right];
                dp[left][right] = Math.max(dp[left][right], coins);
            }
        }
    }

    return dp[1][n];
};

